import React, { Component } from "react";

export default class Mainbanner extends Component {
  render() {
    return (
        <div class="row">
        <div class="col"    >
            <h1>More than a guide</h1>
            <h4>Now you can design your own adventure by just adding the destinations
                <br></br> and we will let you know how much it cost and how much time you need</h4>
        </div>
            </div>
    );
  }
}
